import React from 'react'
import './index.less'
import {Card, Button, Icon, Form, Table} from 'antd'
export default class Record extends React.Component {
    render(){
        const columns = [
            {
              title: 'Date',
              dataIndex: 'Date',
              key: 'Date',
            },
            {
              title: 'Institute',
              dataIndex: 'Institute',
              key: 'Institute',
            },
            {
              title: 'Department',
              dataIndex: 'Department',
              key: 'Department',
            },
            {
                title: 'Dept Phone',
                dataIndex: 'Dept Phone',
                key: 'Dept Phone',
            },
            {
                title: 'Status',
                dataIndex: 'Status',
                key: 'Status',
            },

          ];
        return (
            <div class="container">
                <Card className="cardWrap" bordered={false} bodyStyle={{padding: "24px 0"}}>
                    <HeaderForm />
                </Card>
                <Card className="cardWrap" bordered={false} style={{border:"transparent"}}>
                    <Table 
                        columns={columns}
                        aligh= {"center"}
                    />;
                </Card>
            </div>
        );
    }
}
class HeaderForm extends React.Component{

    render(){
        return (
            <div className="header">
                <span className="header-title">Medical Record</span>
                <Button className="button-left" size={"large"}><Icon type="filter" /></Button>
                <Button className="button-left" size={"large"}><Icon type="reload" /></Button>
                <Button className="button-left" size={"large"}><Icon type="more" /></Button>
                <Button className="button-right" type="primary" shape="round" size={"large"}><Icon type="plus" />New Record</Button>
            </div>
        );
    }
}
HeaderForm = Form.create({})(HeaderForm);
